# generates data (multipliactions and results) for tests (using python because it can natively multiple big numbers)
# writes tests data in file
import random

f= open("test.txt","w+")
for x in range(20):
    a = random.randint(0,)
    b = random.randint(0,)
    wynik = a*b
    f.write('expect(multiply("'+str(a)+'", "'+str(b)+'")).toEqual("'+ str(wynik)+'");\n')
